import React, {Component} from 'react';
import PropTypes from 'prop-types';

class TimeSelectDialogue extends Component {

    state = {
        startTimeH: 0,
        startTimeM: 0,
        endTimeH: 0,
        endTimeM: 0
    };

    handleInput = (e) => {
        this.setState({
           [e.target.name]: e.target.value
        })
    };

    render() {
        return (
            <div>
                <label>Время начала мероприятия: </label>
                <input type='number' id='startTimeH' name='startTimeH' onChange={this.handleInput}/>
                <label> ч </label>
                <input type='number' id='startTimeM' name='startTimeM' onChange={this.handleInput}/>
                <label> мин</label><br/>
                <label>Время окончания мероприятия: </label>
                <input type='number' id='endTimeH' name='endTimeH' onChange={this.handleInput}/>
                <label> ч </label>
                <input type='number' id='endTimeM' name='endTimeM' onChange={this.handleInput}/>
                <label> мин</label><br/>
            </div>
        );
    }
}

TimeSelectDialogue.propTypes = {};

export default TimeSelectDialogue;
